import Vue from 'vue';
import Router from 'vue-router';
import Createpartcomponent from './views/CreateDataComponent.vue';


Vue.use(Router);

export default new Router({
  routes: [

    {
      path: '/create',
      name: 'CreateDataComponent',
      component: CreateDataComponent,
    },
  ],
});
